class GeoItem{constructor(n,t,i,r,u,f,e){this.country=n;this.region=t;this.postal=i;this.city=r;this.organization=u;this.latitude=f;this.longitude=e}}class GetItems{setResult(n){$(document).ready(()=>{$.get(n,n=>{let t=n;if(t==null||t===undefined){notification.error("Null object accepted",7e3);return}if(t.error!=null){notification.error(n.Error,7e3);return}if(t.gi!=null){$(".mainblock1").show();$(".resultTab").html(this.getGiHTML(t.gi));return}if(t.items!=null){let n;for(let i of t.items)n=`${n}${this.getGiHTML(i)}`;$(".mainblock1").show();$(".resultTab").html(n);return}console.log(n)})})}getGiHTML(n){return`<tr><td><dl class="row">
<dt class="col-sm-3">Country</dt><dd class="col-sm-9">${n.country}</dd>
<dt class="col-sm-3">Region</dt><dd class="col-sm-9">${n.region}</dd>
<dt class="col-sm-3">Postal</dt><dd class="col-sm-9">${n.postal}</dd>
<dt class="col-sm-3">City</dt><dd class="col-sm-9">${n.city}</dd>
<dt class="col-sm-3">Organization</dt><dd class="col-sm-9">${n.organization}</dd>
<dt class="col-sm-3">Latitude</dt><dd class="col-sm-9">${n.latitude.toString()}</dd>
<dt class="col-sm-3">Longitute</dt><dd class="col-sm-9">${n.longitude.toString()}</dd>
</dl></td></tr>`}}class OperationResult{constructor(n,t,i){this.gi=n;this.items=t;this.error=i}}